import React from 'react';
import { useNavigate } from 'react-router-dom';
import logo from './assets/Logo.jpeg';
import './Login.css';

const Register = () => {
    const navigate = useNavigate();

    return (
        <div className="main-wrapper">
            <div className="auth-glass-card">
                <img src={logo} alt="Trellis" className="brand-logo-img" />
                <form className="auth-form-container">
                    <h2 className="auth-header-title">Sign Up</h2>
                    <div className="input-field-group"><input type="text" placeholder="Full Name" required /></div>
                    <div className="input-field-group"><input type="email" placeholder="Email Address" required /></div>
                    <div className="input-field-group"><input type="password" placeholder="Create Password" required /></div>
                    <button type="submit" className="main-action-btn">REGISTER</button>
                    <div className="auth-footer-nav">
                        <span>Already registered?</span>
                        <button type="button" className="auth-switch-link" onClick={() => navigate('/')}>Login Here</button>
                    </div>
                </form>
            </div>
        </div>
    );
};

export default Register;
